import React from 'react';
import { Row, Col, Table, Skeleton } from 'antd';
import CoronaContext from '../context/index';
import { helper } from '../helpers/common';
// import NumberFormat from 'react-number-format';
const columns = [
	{
		title: 'Country',
		dataIndex: 'Country',
		key: 'Country'
	},

	{
		title: 'New Confirmed',
		dataIndex: 'NewConfirmed',
		key: 'NewConfirmed'
	},
	{
		title: 'Total confirmed',
		dataIndex: 'Totalconfirmed',
		key: 'Totalconfirmed'
	},
	{
		title: 'New Deaths',
		dataIndex: 'NewDeaths',
		key: 'NewDeaths'
	},
	{
		title: 'Total Deaths',
		dataIndex: 'TotalDeaths',
		key: 'TotalDeaths'
	},
	{
		title: 'New Recovered',
		dataIndex: 'NewRecovered',
		key: 'NewRecovered'
	},
	{
		title: 'Total Recovered',
		dataIndex: 'TotalRecovered',
		key: 'TotalRecovered'
	}
];
const CountriesVirus = () => {
	const { loading, virus } = React.useContext(CoronaContext);
	if (loading === true || helper.isEmptyObject(virus)) {
		return <Skeleton />;
	}
	return (
		<Row>
			<Col span={24}>
				<Table dataSource={virus.Countries} columns={columns} />
			</Col>
		</Row>
	);
};
export default React.memo(CountriesVirus);
